import React from 'react'
import './UserOption.css'
export const UserOption = () => {
  return (
    <div className='userList'>
        <ul>
            <li>MyBooking</li>
            <Link to='/UserProfile'><li>MyProfile</li></Link>
            <li>Help?</li>
        </ul>
    </div>
  )
}
